import './App.css';
import {BrowserRouter,Route,Routes} from "react-router-dom"
import Login from "./components/Login/index"
import Home from "./components/Home/index"
function App() {
  return (
   <BrowserRouter>
   <Routes>
     <Route path='/' element={<Login />} />
     <Route path='/home' element={<Login />} />
   </Routes>
   </BrowserRouter>
  );
}

export default App;
